import StudioNav from './studioComps/StudioNav';
import StudioSidebar from './studioComps/StudioSidebar';

export default function StudioHome(){
    return (
        <>
            <StudioNav />
            <div className='main'>
                <StudioSidebar />
                <div class="studioscroll">
                    <div class="inner">
                        <div class="line">
                            Channel Content
                        </div>
                    </div>
                </div>
            </div>
        </>
    )
}
